env:
  TERM: rxvt-256color
window:
  padding:
    x: 60
    'y': 60
  opacity: 1
font:
  normal:
    family: JetBrainsMono Nerd Font Mono
    style: Regular
  bold:
    family: JetBrainsMono Nerd Font Mono
    style: Regular
  italic:
    family: JetBrainsMono Nerd Font Mono
    style: Italic
  bold_italic:
    family: JetBrainsMono Nerd Font Mono
    style: Regular Italic
  size: 15
  offset:
    x: 0
    'y': 8
cursor:
  style:
    shape: Beam
    blinking: 'On'
mouse_bindings:
  - mouse: Middle
    mode: ~Vi
    action: PasteSelection
key_bindings:
  - key: Space
    mods: Control
    mode: ~Search
    action: ToggleViMode
  - key: J
    mods: Control
    action: ScrollHalfPageDown
  - key: K
    mods: Control
    action: ScrollHalfPageUp
  - key: K
    mods: Shift
    mode: Vi|~Search
    action: ScrollHalfPageUp
  - key: J
    mods: Shift
    mode: Vi|~Search
    action: ScrollHalfPageDown
colors:
  primary:
    background: '0x192330'
    foreground: '0xcdcecf'
  cursor:
    text: '0xfafafa'
    cursor: '0x383a42'
